Round II

Dec 11, 2012 - Performers: Wenona , Lyla Storm , Bryn Blayne , Sahara Rain and Andre Shakti 


MP4 and WMV + Pics.


Due to the competitive nature of this site, an injury in round one has the Ref Looking for a replacement so the intense action can continue. Pink leads the board by 45 points. Bryn Blain steps in for Team Purple to replace Andre Shakti. Bryn Comes in Fresh and full of energy for the beginning of the round. She's fresh and eager to put her tits in her opponents face and finger fuck team pink to rack up points. Unfortunately, even coming in as a fresh wrestler isn't enough to tie the score. Team Purple tries desperately to catch up. They even steep as low as to dragging one of their opponents across the mat to avoid a tag. In the end, the only thing they really can't avoid is getting fingered and humiliated by never catching up in the second round.

